import React from 'react'
import Mode from '../3d/Mode';
import Navbar from '../Navbar/Navbar';

const Home = () => {
    return (
        <div>
            <Navbar />
            <h1>This is Home Page.</h1>
            <Mode />
        </div>
    )
};

export default Home;
